css:
.git-control .sidebar {
  width: 30%;
  height: 100%;
  float: left;
  border-right: 1px solid #b3cbd0;
  background: inherit;
  padding: 10px 10px 80px 10px;
  overflow-y: scroll;
}
.git-control .sidebar .heading {
  font-weight: bold;
  color: #131d20;
  margin-bottom: 5px;
  position: relative;
  -webkit-user-select: none;
}
.git-control .sidebar .heading .action {
  position: absolute;
  right: 0;
  top: 0;
  display: inline-block;
  cursor: pointer;
  color: #273a3f;
  -webkit-user-select: none;
}
.git-control .sidebar .heading .action:hover {
  color: #131d20;
}
.git-control .sidebar .heading .action span {
  margin-right: 5px;
}
.git-control .sidebar .none .heading .action {
  color: #6796a2;
  cursor: default;
}
.git-control .sidebar .none .heading .action:hover {
  color: #6796a2;
}
